import React from 'react'
import { Link } from 'react-router-dom'

import './Navbar.css'

function Navbar() {
    return (
        <nav 
            className='d-flex justify-content-center align-items-center'
            style={{
                position: 'fixed',
                backgroundColor: 'salmon',
                height: '100vh',
                width: '80px'
            }}
        >
            <ul 
                className='d-flex flex-column justify-content-around align-items-center'
                style={{
                    height: '90%',
                    width: '100%',
                    backgroundColor: '#fff'
                }}
            >
                <Link><li>Desafio 1</li></Link>
                <Link><li>Desafio 2</li></Link>
                <Link><li>Desafio 3</li></Link>
                <Link><li>Desafio 4</li></Link>
            </ul>
        </nav>
    )
}

export default Navbar
